import { SuccessRestReturn } from "../interfaces";

const covidDocument =
  "";

const delay = 0;

const getCovidDocument = (): Promise<SuccessRestReturn<undefined>> => {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve(
        Object.assign({}, { json: () => undefined, text: () => covidDocument })
      );
    }, delay);
  });
};

export default getCovidDocument;
